import styled from 'styled-components';


export const Content = styled.div`
  background:var(--color-white);
   position:fixed;
   margin-top:53px;
   height:40px;
   width:100%;
   border-top:1px solid var(--color-border-top);

  display:flex;


  >ul {
    display:flex;
    justify-content:center;
    align-items:center;

    >li {
      display:flex;
      justify-content:center;
      align-items:center;

    }


    > span{

      display:flex;
      justify-content:center;
      align-items:center;


    }

    }

`;


export const IconImage  = styled.img`
  height

`;
